    "about_me": "Donatello es mi modelo a seguir, ya necesito tenis nuevos otra vez, tengo dos orejas, veinte dedos, dos ojos, una nariz, una boca, un par de nalgas, puedo eructar cuando quiera, me da asco escupir, una vez casí voy a la carcel por una falta administrativa, una vez ví a Teo Gonzales en Zapopan, prefiero ir a un concierto que cualquier otra cosa, una vez estornude en la basilica de la virgen de Zapopan, ví la película de \"Secreto en la Montaña\" con mi mamá, no sé manejar por que me da miedo chocar, no me gusta bailar pero bailo bien chingón (puedo bailar como Thom Yorke), en la primaria casí gano el concurso de lectura, ya tengo nombre para mis hijos, el primer libro que leí fue la biografía del fundador de alcohólicos anónimos, cuando veo \"El Señor De los Anillos\" lloro, me cagan los antros gruperos, el mejor piropo que me han dicho en la calle fue eytele gordito bonito, cuando llueve y se hacen charcos y algún carro moja un peaton pongo cara de enojado pero me estoy riendo por dentro, amo a las mujeres pero no las entiendo, me sale la de \"soy tu mejor amigo\" de Reik en la guitarra, tengo desde el kinder que no me peleo a golpes, odio a Adal Ramones y Paty Chapoy, soy de jalisco y eso no me hace necesariamente mariachero ni gay, una vez me enamore de una maestra. mi fantasía secreta es participar en un robo de banco asi con un guey en una camioneta tirandole balazos a la FBI, no me gusta hablar, de niño dormía debajo de un puesto de tianguis, a veces pienso que todo mi universo esta en mi contra, sé mas chistes de Cristo que de Pepito, tengo un chingo de gente agregada en el MSN y nomas hablo con una persona, yo si me sé la historia del Alejandro \"El Caballo\" Fernandez cuando llego al Hospital san javier con el ano destrozado, una vez en la feria de san marcos hice hablar a 2 mimos, cuando la gente me pregunta como estoy digo bien pero en realidad me estoy muriendo de la tristeza, me cae bien carmen salinas, en la noche no puedo dormir pero en el día si, me caga el programa de 12 corazones, cuando me río mucho se me salen los mocos, tengo mucho tiempo sin ver el océano, una vez me pusé a mear en el parque de colinas y paso la policía y no me vio (por eso casi me meten a la cárcel), en una navidad a mi hermano no le regalarón a Buzz pero a mi si me regalaron a Woody ahahahahahahahahahahahahahaha,una vez en GDL ví a alguien que tocó los cables de luz con los calzones mojados y sobrevivió, me dan miedo las arañas y los payasos, en la secundaria me pateaban en el recreo porque tenía una mochila de spider-man, en las películas de miedo me hago el dormido para no verlas y no me puedan asustar, hasta los 7 años pensaba que las niñas no hacían popó, me caben 2 donitas bimbo en la boca al mismo tiempo, cuando voy caminando en la calle voy narrando en mi cabeza mi vida en ingles, nunca he conocido alguien que hable otomi, me cagan los productos de herbalife, dejé los estudios por que pienso que se va acabar el mundo en el 2012, no me sale bien el bigote, acabe todo street fighter 2 con todos menos con Blanka, mi horoscopo dice que soy un pendejo, no entendi el final de Inception, me gusta sentarme en el lado de las ventanas en los camiones, me lavo los dientes pero no uso enguaje bucal, en mi secundaria había muchos cholos en la salida, los fantasmas no me pelan, cuando voy por la carretera me imagino a mi mismo en una granja saliendo a las 7 am con las botas llenas de caca de vaca, siempre he querido ir a una casa de putas y pagarles a las putas para qué me cuenten chistes de condorito, uso periodico para limpiar ventanas, los mosquitos son mas inteligentes desde hace unos años, no creo en la brujeria ni en el tarot, en la iglesia nomás puedo aplaudir pero no cantar ni danzar,quiero poner un negocio de alquiler de borrachos para fiestas de xv años, no sé sacar raíz cuadrada, de niño sufrí de alexitimia y agorafobia, me gustan las gomas panditas, siempre he querido arrancar a madres un chevrolet chevy en medio de un camino irregular para posteriormente atascarsme  en medio de una zanja de lodo, mi cara es una intensa combinación entre Christian Bale y Luis de Alba, creo que la gente que le pone cinta adhesiva en lugar de una tapa a sus controles remotos estan pendejas, una vez me puse de portero en el futbol rapido y perdimos 14-2, el otro día tuve una visión bastante locochona en la cual yo tomaba un cuchillo cebollero y repentinamente empezaba a descuartizar a la gente de mi alrededor a diestra y siniestra todo esto en cámara lenta mientras se ponía de fondo la canción de The Verve, si, la clásica, Bitter sweet sypmphony, me gusta caminar solo en la calle a las 4 de la mañana, siempre he querido empezar una charla preguntando ¿y que tal su herpes?, cuando sea grande seré de esos viejos que probablemente mueran en la cocina de su casa y nadie se dará cuenta hasta una semana después debido a la peste, todos los sábados vienen los mismos testigos de jehova a querer llevarme por el camino de la luz, me gusta que me abracen, en una inundación perdí todas mis fotos y nomas quedaron de cuando era gordo, en un sueño se me apareció Lorena Ochoa y me dijo que ya no faltara tanto a la iglesia, no he visto Avatar, y ya.",
