    "about_me": "Siembra un Pensamiento, y cosecharás un Acto... siembra un Acto, y cosecharás un Hábito... siembra un Hábito, y cosecharás un Carácter... siembra un Carácter, y.......   \" COSECHARAS TU DESTINO \" !!!\n\nEs bueno que se cumplan tus sue;os, seria genial. Pero es mejor que se cumplan los Sue;os de Aquel que ha tenido preparados para ti, aun desde antes que nacieras !!!\n\nPara que la semilla de su fruto, tiene que morir !!!\n\nEn los tiempos de quebrantamiento y dolor, es donde nuestro \"Caracter\" se desarrolla al Maximo !!!\n\nDios esta mas interesado en desarrollar nuestro Caracter que en Bendecirnos. Por que sus bendiciones quedaran aqui, pero el Caracter que alcancemos a desarrollar en la vida, sera lo unico que nos llevaremos al cielo; y este, sera la esencia de como lo Adoraremos al estar ante su presencia por la eternidad !!!\n\nAl perder todo, me doy cuenta que he ganado bastante... por que ahora... ya no tengo nada que perder !!!\n\nEl dia en que deje de so;ar, es el dia en que comenzare a morir !!!\n\nSe;or... no me regreses de vuelta a la vida con comodidad, no vaya a ser que me desenfoque nuevamente y esta vez ya no este dispuesto a dejarla ir, y deje de luchar por los sue;os y propositos para los que fui creado !!!\n\nSi pudieras ver la Belleza que puede surgir de las Cenizas !!!",
