    "quotes": "VISION:\n-     IR MINISTERIOS estamos llamados a transmitir la revelación del evangelio de Jesucristo utilizando cualquier medio disponible.\n\n-     IR MINISTERIOS tiene el llamado a enseñar a los nacidos de nuevo a disfrutar la vida victoriosa en Jesucristo.\n-     IR MINISTERIOS tiene el llamado de capacitar a líderes, ministros, pastores y discípulos para la propagación del evangelio de gracia de nuestro señor Jesucristo.\n-     IR MINISTERIOS a sido llamado a difundir en todo el mundo el Señorío de Jesucristo así como la posición, condición y derechos del creyente estipulados en el NUEVO PACTO EN SU SANGRE.\n-     IR MINISTERIOS a sido llamado a unir ministerios afines a la visión y apoyarlos a cumplir el llamado que nuestro Padre les ha encomendado.\n-     IR MINISTERIOS tiene el llamado de desenmascarar el engaño del diablo a través del conocimiento de la palabra, así como corregir los errores en que por años la iglesia a estado siendo engañada.\n\nIRM tiene la visión de extender el Reino de los cielos en la tierra a través de la predicación del evangelio de Jesucristo, sembrando la semilla de su Palabra. El hacer llegar el Reino no solo en palabras sino en el Poder del Espíritu Santo. \n\nMISION:\n\n-     Usar cualquier medio para transmitir el mensaje de Fe y Gracia de nuestro Señor Jesucristo.\n-     Enseñar a través de un staff de predicadores los principios estipulados por el Espíritu Santo en el Nuevo Pacto.\n-     Dirigir a los creyentes, enseñándoles desde los rudimentos hasta el alimento sólido, a vivir una vida productiva y de victoria.\n-     Capacitar a líderes, discípulos, pastores y ministros en los principios y enseñanzas de la fe activa y la gracia.\n-     Dar a conocer por todo el mundo la llenura del amor de Dios y de nuestro Señor Jesucristo.",
